Hi all, I am working on custom multicolumn expectations and I found that test cases are not all correct. Any helps would be really appreciate. Here are the following code:

def _spark(cls, column_list, **kwargs):
        min_value = kwargs.get(“min_value”)
        max_value = kwargs.get(‘max_value’)
        columns_to_sum = column_list.columns[:-1]
        column_to_compare = [F.col(column) for column in columns_to_sum]
        sum_of_columns = functools.reduce(operator.add, column_to_compare)
        return (sum_of_columns &gt;= min_value) &amp; (sum_of_columns &lt;= max_value)

